import React, { Component } from "react";
import Layout from "../components/MyLayout";

class ASDF extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "",
      imgPath: "",
      text: "",
      date: this.getDate()
    };
  }

  getDate() {
    const date = new Date();
    const options = {
      weekday: "long",
      year: "numeric",
      month: "long",
      day: "numeric"
    };
    return date.toLocaleDateString(undefined, options);
  }

  render() {
